import React, { Component } from 'react'
import DisplayInfo from './DisplayInfo'
import GeneralInfo from './GeneralInfo'

class Main extends Component {
  constructor(props) {
    super(props)

    this.state = {
       firstName:'',
       lastName:'',
       title:'',
       address:'',
       phonenr:'',
       email:'',
       description:''
